def get(c):
    o = ord(c)
    if o >= font_end or o < font_start:
        return get("?")
    size = font_height * font_width
    start = size * (o - font_start)
    return data[start:size + start]


def write(fb, line, text):
    "Write a line on a framebuffer"
    line_start = 16 - line * font_height
    col = 0
    for cr in text:
        b = get(cr)
        idx = 0
        for _ in range(font_width):
            for j in range(line_start, line_start - font_height, -1):
                fb[col + j] = b[idx]
                idx += 1
            col += 16
